                    "最小:" + jsonData.value[i].min + "    " +
                    "算术平均:" + jsonData.value[i].average + "    " +
                    "σ常数:" + jsonData.value[i].Sigma + "\n" +
                    "Cpk|3σ:" + jsonData.value[i].Cpk3 + "    " +
                    "Cpk|6σ:" + jsonData.value[i].Cpk6 + "    " +
                    "均方差:" + jsonData.value[i].DValue;
            } else {
                titleHTML = "DPE：" + jsonData.value[i].dpe + "\n" +
                    "描述:" + jsonData.value[i].dpeDescription + "\n" +
                    //"最大:" + jsonData.value[i].max + "    " +
                    //"最小:" + jsonData.value[i].min + "    " +
                    "算术平均:" + jsonData.value[i].average + "    " +
                    "σ常数:" + jsonData.value[i].Sigma + "\n" +
                    "Cpk|3σ:" + jsonData.value[i].Cpk3 + "    " +
                    "Cpk|6σ:" + jsonData.value[i].Cpk6 + "    " +
                    "均方差（平均）:" + jsonData.value[i].DValue;
            }
            titlesOption = {
                show: true,
                textAlign: 'left',
                text: titleHTML,
                textStyle: {
                    lineHeight: 20,
                    fontSize: 14,
                    fontWeight: 'bold'
                },
                left: '5%',
                top: 100 + TrendGroupHeight * i
            };
            grids.push(gridOption);
            xAxies.push(xAxiesOption);
            yAxies.push(yAxiesOption);
            series.push(seriesOption);
            titles.push(titlesOption);
            count++;
            if (withX) {
                gridOption = {
                    show: true,
                    borderWidth: 1,
                    shadowColor: 'rgb(0, 255, 255)',
                    shadowBlur: 0,
                    left: '7%',
                    width: '85%',
                    top: TrendGroupPositionTop + TrendGroupHeight * i + TrendGroupTopHeight + 100,
                    height: TrendGroupBottomHeight
                };
                xAxiesOption = {
                    type: 'category',
                    boundaryGap: false,
                    show: true,
                    data: jsonData.value[i].ts,
                    gridIndex: count
                };
                var color = ["#5470c6", "#91cc75", "#fac858", "#ee6666", "#73c0de", "#3ba272", "#fc8452", "#9a60b4", "#ea7ccc"];
                seriesOption = {
                    name: '极差曲线',
                    type: 'line',
                    xAxisIndex: count,
                    yAxisIndex: count,
                    symbol: "circle",
                    color: color[i],
                    showSymbol: true,
                    legendHoverLink: true,
                    clip: false, //  true：裁掉所有超出坐标系的折线部分，拐点图形的逻辑按照散点图处理
                    data: jsonData.value[i].dataX,
                    showAllSymbol: true,
                    markPoint: {
                        data: [
                            {type: 'max', name: '最大值'},
                            {type: 'min', name: '最小值'}
                        ]
                    },
                    lineStyle: {
                        width: 1,

                    },
                    label: {
                        show: false,
                        position: 'top',
                        formatter: '{a}'

                    },
                    emphasis: {
                        scale: false,
                        focus: 'none',
                        blurScope: 'coordinateSystem'
                    }
                };
                yAxiesOption = {
                    type: 'value',
                    show: true,
                    scale: true,
                    gridIndex: count,
                    //min: jsonData.value[i].trendMin,
                    //max: jsonData.value[i].trendMax,
                    axisLabel: {
                        interval: 0
                    }
                };
                titlesOption = {
                    show: true,
                    textAlign: 'left',
                    text: '极差曲线，R=Absolute(|V|n - V|n-1) ',
                    textStyle: {
                        fontSize: 14,
                        fontWeight: 'bold'
                    },
                    left: '5%',
                    top: TrendGroupPositionTop + TrendGroupHeight * i + TrendGroupTopHeight + 40,

                };
                grids.push(gridOption);
                xAxies.push(xAxiesOption);
                yAxies.push(yAxiesOption);
                series.push(seriesOption);
                titles.push(titlesOption);
                count++;
            }
        };
        option = {
            animation: false,
            tooltip: {
                trigger: 'axis'
            },
            legend: {
                data: []
            },
            toolbox: {
                show: true,
                feature: {

                    dataZoom: {
                        show: true
                    },
                    dataView: {
                        readOnly: false
                    },
                    magicType: {
                        type: ['line']
                    },
                    restore: {},
                    saveAsImage: {}
                }
            },
            title: titles,
            grid: grids,
            xAxis: xAxies,
            yAxis: yAxies,
            series: series
        };
    }
    setOptionsConfig(true);
    if (option && typeof option === 'object') {
        myChart.setOption(option);
    }
    $(window).resize(function () {
        myChart.resize()
    })
</script>

</body>
</html>
